import React, {useEffect, useState} from 'react';
import getGifDetail from '../../services/getGifDetail';
import { Link } from 'react-router-dom';
import { useParams } from 'react-router-dom';


const GifDetail = () => {

  const params = useParams()
  const [gifDetail, setGifDetail] = useState(null);

  useEffect(()=>{
    getGifDetail(params.id, setGifDetail);
    console.log(gifDetail)
  },[])


  

  return (
    <div className="gifDetail">
      {gifDetail != null ? (
      <div className='row' >
        <Link to="/"><a className="btn btn-primary mb-4 ">Go Back</a></Link>
        <div className='col-4' >
          <img width="100px" height="100px" src={gifDetail.images.original.url} />
        </div>
        
      </div>
      ): "Loading..."}
    </div>
  );
}

export default GifDetail;
